trict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"829512","type":"CustomJS"},{"attributes":{"coordinates":null,"group":null},"id":"829405","type":"Title"},{"attributes":{"coordinates":null,"formatter":{"id":"829131"},"group":null,"major_label_policy":{"id":"829411"},"ticker":{"id":"829102"},"visible":false},"id":"829101","type":"LinearAxis"},{"attributes":{},"id":"829115","type":"SaveTool"},{"attributes":{"coordinates":null,"data_source":{"id":"829125"},"glyph":{"id":"829394"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"829396"},"nonselection_glyph":{"id":"829395"},"view":{"id":"829398"}},"id":"829397","type":"GlyphRenderer"},{"attributes":{"toolbar":{"id":"829598"}},"id":"829599","type":"ToolbarBox"},{"attributes":{"label":{"value":"Final (113%)"},"renderers":[{"id":"829208"}]},"id":"829226","type":"LegendItem"},{"attributes":{},"id":"829249","type":"Selection"},{"attributes":{"sou
